import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function CompanyRegister() {
  const [companyName, setCompanyName] = useState('');
  const [industry, setIndustry] = useState('');
  const [companySize, setCompanySize] = useState('');
  const [companyLogo, setCompanyLogo] = useState(null);
  const [companyEmail, setCompanyEmail] = useState('');
  const [document, setDocument] = useState(null);
  const [password, setPassword] = useState('');
  const [errors, setErrors] = useState({});
  const [isModalOpen, setIsModalOpen] = useState(false);

  const navigate = useNavigate();
  const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

  const handleRegister = (e) => {
    e.preventDefault();
    const newErrors = {};

    // Validate form fields
    if (!companyName) newErrors.companyName = 'Company name is required';
    if (!industry) newErrors.industry = 'Industry is required';
    if (!companySize) newErrors.companySize = 'Company size is required';
    if (!companyLogo) newErrors.companyLogo = 'Company logo is required';
    if (!companyEmail) {
      newErrors.companyEmail = 'Email is required';
    } else if (!emailRegex.test(companyEmail)) {
      newErrors.companyEmail = 'Invalid email format';
    }
    if (!document) newErrors.document = 'Document is required';
    if (!password) newErrors.password = 'Password is required';

    setErrors(newErrors);
    if (Object.keys(newErrors).length > 0) return;

    const companyData = {
      companyName,
      industry,
      companySize,
      companyEmail,
      password,
      logoName: companyLogo?.name,  // Only store the file name (or metadata)
      documentName: document?.name,  // Only store the document name (or metadata)
      isAccepted: false,
      hasNotification: false,
    };

    try {
      let companies = JSON.parse(localStorage.getItem('companies')) || [];
      companies.push(companyData);
      localStorage.setItem('companies', JSON.stringify(companies));
      setIsModalOpen(true);
    } catch (error) {
      console.error('Error saving company data to localStorage', error);
    }
  };

  return (
    <div>
      <form onSubmit={handleRegister}>
        <input
          type="text"
          placeholder="Company Name"
          value={companyName}
          onChange={(e) => setCompanyName(e.target.value)}
        />
        <span>{errors.companyName}</span>

        <input
          type="text"
          placeholder="Industry"
          value={industry}
          onChange={(e) => setIndustry(e.target.value)}
        />
        <span>{errors.industry}</span>

        <input
          type="text"
          placeholder="Company Size"
          value={companySize}
          onChange={(e) => setCompanySize(e.target.value)}
        />
        <span>{errors.companySize}</span>

        <input
          type="file"
          accept="image/*"
          onChange={(e) => setCompanyLogo(e.target.files[0])}
        />
        <span>{errors.companyLogo}</span>

        <input
          type="email"
          placeholder="Company Email"
          value={companyEmail}
          onChange={(e) => setCompanyEmail(e.target.value)}
        />
        <span>{errors.companyEmail}</span>

        <input
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
        <span>{errors.password}</span>

        <input
          type="file"
          accept=".pdf,.doc,.docx"
          onChange={(e) => setDocument(e.target.files[0])}
        />
        <span>{errors.document}</span>

        <button type="submit">Register</button>
      </form>

      {isModalOpen && (
        <div>
          <p>Company registration successful!</p>
          <button onClick={() => navigate('/view-registration')}>Go to Pending View</button>
        </div>
      )}
    </div>
  );
}

export default CompanyRegister;
